// src/components/MapSection.js
import React from 'react';

const MapSection = () => {
    return (
        <section className="map-section">
            <h2>Our Location</h2>
            <iframe 
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!..." 
                width="100%" 
                height="450" 
                style={{ border: 0 }} 
                allowFullScreen="" 
                loading="lazy"
            ></iframe>
        </section>
    );
};

export default MapSection;
